import React from 'react';

function ProgressBar() {
  const containerStyles = {
    maxWidth: '600px',
    margin: '0 auto',
  };

  const progressBarStyles = {
    width: '80%',
    height: '12px',
    backgroundColor: '#f1f1f1',
    borderRadius: '6px',
    margin: '10px 0',
    position: 'relative',
  };

  const progressFillStyles = {
    height: '100%',
    backgroundColor: '#4CAF50',
    borderRadius: '6px',
    position: 'absolute',
    top: '0',
    left: '0',
  };

  const progressLabelStyles = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    color: '#333',
    fontSize: '16px',
    fontWeight: 'bold',
    textTransform: 'uppercase',
  };

  return (
    <section id="skills">
      <h2>Skills</h2>
      <div style={containerStyles}>
        <div>
          <span style={{ marginBottom: '5px' }}>HTML/CSS</span>
          <div style={progressBarStyles}>
            <div style={{ ...progressFillStyles, width: '90%' }}></div>
          </div>
          <span style={progressLabelStyles}>90%</span>
        </div>
        <div>
          <span style={{ marginBottom: '5px' }}>JavaScript</span>
          <div style={progressBarStyles}>
            <div style={{ ...progressFillStyles, width: '80%' }}></div>
          </div>
          <span style={progressLabelStyles}>80%</span>
        </div>
        <div>
          <span style={{ marginBottom: '5px' }}>React</span>
          <div style={progressBarStyles}>
            <div style={{ ...progressFillStyles, width: '70%' }}></div>
          </div>
          <span style={progressLabelStyles}>70%</span>
        </div>
      </div>
    </section>
  );
}

export default ProgressBar;
